DLive and its blockchain development team will collaborate with the BitTorrent team to bolster its products and services. BLive, the live streaming platform introduced by BitTorrent in early 2019, will be merged into the DLive platform, and their team will join the DLive team. DLive will begin utilizing the BitTorrent File-Sharing System (BTFS), a distributed file sharing and storage system, to allow all content living on DLive to truly move towards decentralization. DLive will also merge its account systems with BitTorrent's to further integrate each community with the other. With this collaborative effort, BitTorrent's 100 million monthly active users can easily gain access to DLive's service offerings; solidifying the live streaming giant as one of the largest in the world.

